import React, { Component } from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import drilldown from 'highcharts/modules/drilldown';


const options = {
    chart: {
        type: 'column'
      },
      title: {
        text: 'My chart'
      },
      series: [
        {
          data: [[1, 3], [2, 5], [3, 7], [4, 1], [3.6, 5], [6, 4]]
        }
      ]
};



class ChartDisplayMain extends Component {
    state = {  }
    render() { 
        return ( 
            <div className='App' style={{width: '55%', border: '1px solid black'}}>
              <HighchartsReact highcharts={drilldown(Highcharts)} options={options} />  
            </div>
         );
    }
}

export default ChartDisplayMain;
